import React from "react";

function CheckInTable({ checkins }) {
  return (
    <div>
      <h2>All Check-ins</h2>
      <table>
        <thead>
          <tr>
            <th>Student Name</th>
            <th>Time</th>
          </tr>
        </thead>
        <tbody>
          {checkins.map((c, index) => (
            <tr key={index}>
              <td>{c.student_name}</td>
              <td>{new Date(c.time).toLocaleString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default CheckInTable;
